// src/pages/Create .jsx
import React, { useState, useEffect,  useCallback } from "react";
import {
  FormGroup,
  TextField,
  MenuItem,
  Select,
  InputLabel,
  Typography,
  Button,
  Box,
  FormControl,
} from "@mui/material";
import { socket } from "../modules/socket";
import axios from "axios";
import { Navigate } from "react-router-dom";

function Create ({ user, setUser }) {
  const [roomID, setRoomID] = useState("");
  const [submitted, setSubmitted] = useState(false);

  const [state, setState] = useState({
    username: "",
    lives: "6",
    numRounds: "3",
    rotation: "king",
    time: "30",
  });

  const validateUsername = (name) => {
    if (!/^[^\s]+(\s+[^\s]+)*$/.test(name)) return "No leading/trailing spaces";
    if (name.length > 20) return "Max 20 characters";
    return "";
  };

  const handleLink = useCallback(
    ({ gameState, roomID }) => {
      setUser(gameState.players[0]);
      setRoomID(roomID);
    },
    [setUser]
  );

  useEffect(() => {
    socket.on("link", handleLink);
    return () => socket.off("link", handleLink);
  }, [handleLink]);

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!state.username.trim()) return;
    setSubmitted(true);
    socket.emit("create", state);
  };

  if (user && roomID) return <Navigate to={`/${roomID}`} />;

  return (
    <Box sx={{ p: 4, maxWidth: 600, mx: "auto" }}>
      <Typography variant="h3" sx={{ mb: 3 }}>
        Create Game
      </Typography>

      <form onSubmit={handleSubmit}>
        <FormGroup>
          <TextField
            label="Username"
            variant="filled"
            value={state.username}
            onChange={(e) => setState({ ...state, username: e.target.value })}
            error={!!validateUsername(state.username)}
            helperText={validateUsername(state.username)}
            required
            margin="normal"
          />

          <TextField
            label="Lives"
            type="number"
            variant="filled"
            value={state.lives}
            onChange={(e) => setState({ ...state, lives: e.target.value })}
            margin="normal"
          />

          <TextField
            label="Rounds"
            type="number"
            variant="filled"
            value={state.numRounds}
            onChange={(e) => setState({ ...state, numRounds: e.target.value })}
            margin="normal"
          />

          <FormControl variant="filled" margin="normal">
            <InputLabel>Rotation</InputLabel>
            <Select
              value={state.rotation}
              onChange={(e) => setState({ ...state, rotation: e.target.value })}
            >
              <MenuItem value="king">King of the Hill</MenuItem>
              <MenuItem value="robin">Round Robin</MenuItem>
            </Select>
          </FormControl>

          <FormControl variant="filled" margin="normal">
            <InputLabel>Guess Time (sec)</InputLabel>
            <Select
              value={state.time}
              onChange={(e) => setState({ ...state, time: e.target.value })}
            >
              {["10","20","30","40","50","60","70","80","90","inf"].map((t) => (
                <MenuItem key={t} value={t}>{t}</MenuItem>
              ))}
            </Select>
          </FormControl>

          <Button
            type="submit"
            variant="contained"
            sx={{ mt: 2 }}
            disabled={submitted || !!validateUsername(state.username)}
          >
            Create Game
          </Button>
        </FormGroup>
      </form>
    </Box>
  );
}

export default Create ;
